                        {
                            Id = 1L,
                            Description = "На занятиях по математике слушатели IT-академии занимаются\r\n\r\n решением задач игрового, логического и занимательного характера с целью выявления и развития математических способностей и углубления интереса к математике, а также повышения общего уровня математических знаний, умений и навыков.\r\n Кроме того в рамках курсов подробно разбираются задачи различных математических олимпиад, турниров и конкурсов.\r\n Продемонстрировать полученные умения и навыки учащиеся могут приняв участие в следующих мероприятиях:\r\nМеждународный математический Турнир городов (по г.Витебску)\r\n Республиканский турнир юных математиков\r\n Районные и областные этапы республиканской олимпиады школьников по математике и многих других мероприятиях\r\n Слушатели, проявившие себя с наилучшей стороны, могут принять участие в работе Республиканской летней научно-исследовательской школы “Бригантина”.\r\n Для учащихся 10-11 классов в рамках работы секции проводятся курсы подготовки к ЦТ.\r\n",
                            Image = "/assets/for_new/img/courses/c/c.svg",
                            Name = "Математика"
                        },
                        new
                        {
                            Id = 2L,
                            Description = "В рамках секции информатики и программирования занятия проводятся по следующим направлениям:\r\n\r\n Scratch-программирование: курс предназначен для самых юных слушателей TI-академии и направлен на изучение основ алгоритмизации и программирования на базе языка Scratch.\r\nJava для начинающих: язык программирования Java является одним из наиболее популярных и распространенных в мире на текущий момент. В рамках данного курса ученики познакомятся с его синтаксисом и изучат способы его применения для решения задач.\r\nWeb-программирование: курс посвящен изучению таких технологий как HTML/CSS/JS, которые применяются при разработке сайтов и клиентской частей интернет-приложений.\r\n Компьютерная графика и web-дизайн: данный курс будет полезен всем, кто занимается художественным творчеством и желает использовать компьютер как инструмент в художественной деятельности.\r\n Кроме того, учащиеся IT-академии имеют возможность проявить себя, принимая участие в различных мероприятиях и соревнованиях по информатике и программированию как республиканского так и международного уровня.\r\n",
                            Image = "/assets/for_new/img/courses/c/c.svg",
