                        {
                            Id = 3L,
                            Content = "<p>\r\n <h>Полноценное планомерное обучение, включающее в себя изучение естественных наук совокупно с инженерией, технологией и математикой, представляет собой STEM образование. По сути, это учебный план, который спроектирован на основе идеи обучения учащихся с применением междисциплинарного и прикладного.</h6>   \r\n    <br>\r\n  <h>Современная прогрессивная система, в отличие от традиционного обучения, представляет собой смешанную среду, которая позволяет на практике продемонстрировать, как данный изучаемый научный метод может быть применен в повседневной жизни. Учащиеся помимо математики и физики исследуют робототехнику и программирование. Дети воочию видят применение знаний точных дисциплин.</h6><br><br>\r\n   <p> <img src=\"/images/AC4lMeuSbyqK5vW.jpg\" /><br><br>\r\n       <h><b>Преимущества STEM технологий в образовании:</b></h6>\r\n    <ul>\r\n      <li><p><h>Активация коммуникативных навыков. Внедрение данной системы в основном включает в себя командную работу. Ведь большую часть времени дети совместно исследуют и развивают свои модели. Они учатся строить диалог с инструкторами и своими друзьями.</h6></p></li>\r\n    <li><p><h>Совершенствование навыков критического мышления. Учащиеся и студенты учатся преодолевать нестандартные задачи путем тестирования и проведения различных опытов. Все это позволяет им подготовиться ко взрослой жизни, где они могут столкнуться с необычными, нестандартными проблемами.</h6></p></li>\r\n  <li><p><h>STEM-образование является своеобразным мостом, соединяющий учебный процесс, карьеру и дальнейший профессиональный рост. Инновационная образовательная концепция позволит на профессиональном уровне подготовить детей к технически развитому миру.</h6></p></li>\r\n  </p>\r\n </ul>  </p>  \r\n  <br><br>",
                            Image = "/assets/for_new/img/icons/grow.svg",
                            TextPreview = "Каждый ребенок может достичь своей цели",
                            Title = "STEM образование"
                        },
                        new
                        {
                            Id = 4L,
                            Content = "<h3 style=\"display: flex;\">Учащиеся курсов IT-академии “МИР будущего” могут принимать участие в следующих мероприятиях: </h3>\r\n\r\n     <ul>\r\n      <li><p><h>Международный математический Турнир городов и Республиканский турнир юных математиков</h6></p></li>\r\n    <li><p><h>Районные и областные этапы республиканской олимпиады школьников по математике, физике и информатике</h6></p></li>\r\n  <li><p><h>Областная практическая конференция “Эврика” и республиканская практическая конференция (конкурс исследовательских работ) учащихся</h6></p></li>\r\n     <li><p><h>Республиканская летняя научно-исследовательская школа “Бригантина”</h6></p></li>\r\n  <li><p><h>Олимпиада по программированию в рамках недели факультета</h6></p></li>\r\n  <li><p><h>Областная научно-техническая конференция «Квант»</h6></p></li>\r\n   <li><p><h>Республиканский конкурс научно-технического творчества учащейся молодежи «ТехноИнтеллект»</h6></p></li>\r\n        <li><p><h>Республиканская олимпиада по робототехнике среди учащейся молодежи</h6></p></li>\r\n  <li><p><h>Областная олимпиада по программированию \"Информаша\"</h6></p></li>\r\n     <li><p><h>Областная олимпиада по информатике \"Юный программист\"</h6></p></li>\r\n    <li><p><h>Акция \"Час кода\"</h6></p></li>\r\n     </ul>    \r\n <br><br>",
                            Image = "/assets/for_new/img/icons/wins.svg",
                            TextPreview = "В турнирах, как внутри коликтива, так и за его пределами",
                            Title = "Мероприятия"
