                        new
                        {
                            Id = 5L,
                            Content = "<p>\r\n  <h>В наше время наблюдается бурное развитие вычислительной техники и робототехники. Уже сейчас представители многих профессий могут быть эффективно заменены автоматическими устройствами. Как примеры можно назвать такие профессии, как: работник склада, экономист, бухгалтер, курьер, медработник, оператор колл-центра, продавец, водитель, военный, строитель, уборщик и многие другие.</h6>   \r\n  <br><br><p>\r\n  <img src=\"/images/ANDWthYmyce1O6v.jpg\" /></p>\r\n   <br><br>\r\n      <h>Однако вместо множества профессий и специальностей, востребованность в которых уменьшиться, появляются новые. Так например, нужны будут инженеры и техники, которые будут создавать эти устройства. Программисты, которые будут писать программное обеспечение. Тестировщики и специалисты по качеству ПО, бизнес-аналитики, дизайнеры и т.д.</h6> \r\n   <br><br><p>\r\n     <img src=\"/images/IF9ZGjAWdRe2VSx.jpg\" /></p>\r\n  <br><br>\r\n <h>В связи с этим, профессии связанные с IT-индустрией в течении следующих лет будут одними из самых востребованных и высокооплачиваемых как у нас, так и во всем мире. В IT-академии мы всегда ориентируемся на будущее и на обучение тем навыкам, которые необходимы для IT-специалистов высочайшего уровня.</h6> \r\n  <br><br><p>\r\n  <img src=\"/images/enNXbo0mUf5IlwQ.jpg\" /></p>",
                            Image = "/assets/for_new/img/icons/plau.svg",
                            TextPreview = "В хорошей компании и знакомство с интересными людьми",
                            Title = "Ориентация на будущее"
                        });
                });

